import React from 'react'
import '../GofundNFT.css';
import 'bootstrap/dist/css/bootstrap.min.css';


import GoFundImg from "../images/GoFundImg.png";
import CetaBaixo from "../images/Vector.png";

function GofundNFT(){
    return (
      <div class="container-fluid "  >      
        <div class="row ">
            <div class="col-lg-7 col-md-12 col-sm-12">
                <img  src={GoFundImg} 
                        class="img-fluid"  
                        alt="FundoGoTokens"
                        style={{marginLeft:'-13px' }}
                        >
                </img> 
            </div>     
            <div class="col-lg-5 col-md-12 col-sm-12" >
                <div id="Apresentando">
                    <p  style={{color:'#A19D9D', fontSize:'14px', fontWeight:'700'}}>APRESENTANDO...</p>

                    <h1 className="gradient" style={{marginTop:'-15px', fontSize:'48px',fontWeight:'700'}}>GoFund NFT</h1>

                    <p style={{marginTop:'13px',color:'#454545', fontSize:'18px', fontWeight:'700'}} >Gere receita e conquiste mais fãs através da emissão de tokens</p>

                    <p className="gradient" style={{marginTop:'22px', fontSize:'14px', fontWeight:'700'}}>ROLE ABAIXO PARA SABER MAIS
                    <img  src={CetaBaixo}class="img-fluid" style={{height:"18px", width:"17px",marginLeft:"227px",marginTop:"-45px"}} alt=""/>
                    </p>
                </div>       
            </div>
        </div>
      </div>
        
    );
}

export default GofundNFT;
